import React, { useState } from 'react';
import { Box, Button, TextField, Typography, Card, CardContent, CardMedia, Grid, List, ListItem, ListItemText } from '@mui/material';
import { uploadPhoto } from '../services/api';

const UploadForm: React.FC = () => {
    const [photos, setPhotos] = useState<File[]>([]);
    const [previewUrls, setPreviewUrls] = useState<string[]>([]); // State to store preview URLs
    const [prompt, setPrompt] = useState<string>('');
    const [description, setDescription] = useState<string>('');
    const [analysisResults, setAnalysisResults] = useState<any[]>([]);

    const handlePhotoChange = (event: React.ChangeEvent<HTMLInputElement>) => {
        if (event.target.files && event.target.files.length > 0) {
            const selectedPhotos = Array.from(event.target.files);
            setPhotos(selectedPhotos);

            // Generate preview URLs for the selected photos
            const urls = selectedPhotos.map(photo => URL.createObjectURL(photo));
            setPreviewUrls(urls);
        }
    };

    const handleSubmit = async () => {
        if (photos.length > 0) {
            const results = [];
            for (const photo of photos) {
                const formData = new FormData();
                formData.append('photo', photo);
                formData.append('prompt', prompt);
                if (description) {
                    formData.append('description', description);
                }
                try {
                    const response = await uploadPhoto(formData);
                    results.push(response.data);
                } catch (error) {
                    console.error('Error uploading photo:', error);
                }
            }
            setAnalysisResults(results); // Store all results in state
        } else {
            console.log('No photos selected');
        }
    };

    return (
        <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', gap: 4, mt: 4 }}>
            <Typography variant="h5" gutterBottom>Upload Photos for Analysis</Typography>
            <TextField
                label="Prompt"
                value={prompt}
                onChange={(e) => setPrompt(e.target.value)}
                fullWidth
                variant="outlined"
            />
            <TextField
                label="Description (optional)"
                value={description}
                onChange={(e) => setDescription(e.target.value)}
                fullWidth
                variant="outlined"
            />
            <Button variant="contained" component="label">
                Select Photos ({photos.length} selected) {/* Show count of selected photos */}
                <input type="file" hidden accept="image/*" onChange={handlePhotoChange} multiple />
            </Button>
            <Button variant="contained" onClick={handleSubmit} disabled={photos.length === 0}>
                Submit
            </Button>

            {previewUrls.map((url, index) => (
                <Card sx={{ width: 150, mt: 2 }} key={index}>
                    <CardMedia
                        component="img"
                        alt={`Photo Preview ${index + 1}`}
                        height="150"
                        image={url}
                        title={`Photo Preview ${index + 1}`}
                        sx={{ objectFit: 'cover' }}
                    />
                </Card>
            ))}

            {analysisResults.map((result, index) => (
                <Card sx={{ maxWidth: 800, mt: 4 }} key={index}>
                    <CardMedia
                        component="img"
                        alt={`Uploaded Photo ${index + 1}`}
                        height="400"
                        image={`http://localhost:3000${result.filePath}`}
                        title={`Uploaded Photo ${index + 1}`}
                    />
                    <CardContent>
                        <Typography variant="h6" gutterBottom>
                            Analysis Result for Photo {index + 1}
                        </Typography>
                        <Grid container spacing={2}>
                            <Grid item xs={12}>
                                <List>
                                    {result.analysis.recommendations.split(',').map((recommendation: string, idx: number) => (
                                        <ListItem key={idx}>
                                            <ListItemText primary={recommendation.trim()} />
                                        </ListItem>
                                    ))}
                                </List>
                            </Grid>
                        </Grid>
                    </CardContent>
                </Card>
            ))}
        </Box>
    );
};

export default UploadForm;
